import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import { Typography, Collapse, Switch, FormControlLabel } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

function ManageExamSP() {
    // State for controlling the visibility of each text
    const [open1, setOpen1] = useState(false);
    const [open2, setOpen2] = useState(false);
    const [open3, setOpen3] = useState(false);

    // Function to handle confirm button click
    const handleConfirm = () => {
        console.log("Confirm button clicked");
    };

    // Function to handle edit button click
    const handleEdit = () => {
        console.log("Edit button clicked");
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <Box sx={{ marginLeft: 40 }}>
                                <Typography sx={{ marginLeft: 30 }}>
                                    <h1>จัดการการยื่นสอบ</h1>
                                </Typography>

                                {/* Toggle switches */}
                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open1} onChange={() => setOpen1(!open1)} />}
                                        label="Toggle การสอบหัวข้อ"
                                    />
                                    <Collapse in={open1}>
                                        <Typography sx={{ minWidth: 250, marginTop: 1 }}>
                                            การสอบหัวข้อ
                                        </Typography>
                                    </Collapse>
                                </Box>

                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open2} onChange={() => setOpen2(!open2)} />}
                                        label="Toggle การสอบก้าวหน้า"
                                    />
                                    <Collapse in={open2}>
                                        <Typography sx={{ minWidth: 250, marginTop: 1 }}>
                                            การสอบก้าวหน้า
                                        </Typography>
                                    </Collapse>
                                </Box>

                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open3} onChange={() => setOpen3(!open3)} />}
                                        label="Toggle การสอบป้องกัน"
                                    />
                                    <Collapse in={open3}>
                                        <Typography sx={{ minWidth: 250, marginTop: 1 }}>
                                            การสอบป้องกัน
                                        </Typography>
                                    </Collapse>
                                </Box>

                                <Box>
                                    <Button sx={{ marginTop: 5, marginLeft: 30, marginRight: 10 }} variant="contained" onClick={handleConfirm}>
                                        Confirm
                                    </Button>
                                    <Button sx={{ marginTop: 5 }} variant="contained" onClick={handleEdit}>
                                        Edit
                                    </Button>
                                </Box>
                            </Box>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
}

export default ManageExamSP;
